script: |
  super -f text -I q6057.spq | sort > q6057.out

inputs:
  - name: q6057.spq
    data: |
      SELECT DISTINCT + - col0 AS col1 FROM tab2 (FORMAT parquet) WHERE NOT - 96 + - 92 IN ( - - col0, col1 * - col0 + - col2, - 8 + col1 + + 83 );
  - name: tab2

outputs:
  - name: q6057.out
    data: |
      -46
      -64
      -75
